window.bookSummaryJSON = "<p><b>A novella set in the universe of James S. A. Corey's </b><b><i>NYT </i></b><b>best-selling Expanse series, Auberon explores a new and alien world and the age-old dangers that humanity has carried with it to the stars. Now a Prime Original series.</b></p> <p><b>Hugo Award Winner for Best Series</b></p> <p>Auberon is one of the first and most important colony worlds in humanity's reach, and the new conquering faction has come to claim it. Governor Rittenaur has come to bring civilization and order to the far outpost and guarantee the wealth and power of the Empire.</p> <p>But Auberon already has its own history, a complex culture, and a criminal kingpin named Erich with very different plans. In a world of deceit, violence, and corruption, the greatest danger Rittenaur faces is love.</p> <p><b>The Expanse</b><br> <i>Leviathan Wakes</i> <br> <i>Caliban's War</i> <br> <i>Abaddon's Gate</i> <br> <i>Cibola Burn</i> <br> <i>Nemesis Games </i><br> <i> Babylon's Ashes</i> <br> <i>Persepolis Rising</i> <br> <i>Tiamat's Wrath </i></p> <p><b>The Expanse short fiction</b><br> <i>The Butcher of Anderson Station</i> <br> <i>Gods of Risk</i> <br> <i>The Churn</i> <br> <i>The Vital Abyss</i> <br> <i>Strange Dogs</i><br> <i> Auberon</i></p>"; 
